import React from 'react'
import {Text} from '@chakra-ui/react'

const IsiTweet = (props) => {
    const {tweet, pp} = props;
    return (
        <div>
            <Image src={pp} w="50px" h="50px" bg="gray.50" mt="10px"  ml="10px" borderRadius="100%" />
            <Text fontSize="15px" color="white">{tweet}</Text>
        </div>
    )
}

export default IsiTweet
